import React, { Component } from 'react';

import {
    DefaultPalette,
    Stack,
    IStackStyles,
    IStackTokens
} from 'office-ui-fabric-react';

const stackStyles: IStackStyles = {
    root: {
        background: '#fff2ff',
    },
};

const themedMediumStackTokens: IStackTokens = {
    childrenGap: 'l2',
    padding: 'l2',
};

const itemStyles: React.CSSProperties = {
    alignItems: 'center',
    background: '#235233',
    color: '#235233',
    display: 'flex',
    justifyContent: 'center',
    widfth: 64
};

class Navbar extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Stack horizontal styles={stackStyles} tokens={themedMediumStackTokens}>
                <Stack.Item styles={itemStyles}></Stack.Item>
                <Stack.Item styles={itemStyles}>Home</Stack.Item>
                <Stack.Item styles={itemStyles}>People</Stack.Item>
                <Stack.Item styles={itemStyles}>About</Stack.Item>
                <Stack.Item styles={itemStyles}>Blog</Stack.Item>
            </Stack>
        )
    }
}

export default Navbar;
